import React from 'react';

const Support = () => {
  return (
    <div className="support">
      <h1>Поддержка</h1>
      <p>Чат или телефонная линия для консультаций по выбору комплектующих.</p>
      <p>FAQ для решения распространённых вопросов.</p>
      <h2>Часто задаваемые вопросы</h2>
      <ul>
        <li>Как выбрать подходящий процессор?</li>
        <li>Какую видеокарту выбрать для игр?</li>
        <li>Сколько оперативной памяти нужно для работы?</li>
      </ul>
      <h2>Свяжитесь с нами</h2>
      <p>Телефон: +7 (123) 456-78-90</p>
      <p>Email: support@pcconfigurator.com</p>
    </div>
  );
};

export default Support;
